Changing habits isn‚Äôt an easy task and often we create plans that are set up to fail.

Trying to change your habits will pretty much always fail if you try and change too much too soon. You may be okay changing loads of things in the first week but you can‚Äôt maintain it, changing a habit takes patience and dedication. 

Instead change one habit at a time. However small, whether it‚Äôs eating less chocolate, or having one less glass of wine on a Friday night, maybe it‚Äôs going to the gym once a week or taking up walking as a new healthy  hobbie. It could be any habit you are trying to change, but only tackle one at a time and only move on to the next habit you would like to change once you are confident you have changed the current habit. 

Be realistic with yourself. Being realistic is the only way to make actual progress. Pick one habit and focus only on that. 

